Swati: Imindeni lenebantfwana labancane ingase idzinge kulungiselela kakhudlwana, kodvwa lilanga linye nje ungephandle lingatilungela ngisho netinswane nebantfwana labasafundza enkhulisa. 
English:
The following is a list of the items that are to be delivered to the United Nations Office at Geneva:
1. The following documents are to be delivered to the United Nations Office at Geneva:
a. The report of the Secretary-General on the work of the Organization (A/51/1);
b. The report of the Secretary-General on the work of the Organization (A/51/2);
c. The report of the Secretary-General on the work of the Organization (A/51/3);

